package com.geeks.hmgeeks_331;

import android.os.Bundle;

import androidx.annotation.NonNull;
import androidx.annotation.Nullable;
import androidx.fragment.app.Fragment;
import androidx.recyclerview.widget.RecyclerView;

import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;

import com.geeks.hmgeeks_331.databinding.FragmentRVBinding;

import java.util.ArrayList;

public class RVFragment extends Fragment {

    FragmentRVBinding binding;
    CarAdapter adapter;
    private ArrayList<String> carList = new ArrayList<>();
    private ArrayList<String> imageList = new ArrayList<>();

    @Override
    public View onCreateView(LayoutInflater inflater, ViewGroup container,
                             Bundle savedInstanceState) {
        // Inflate the layout for this fragment
        binding = FragmentRVBinding.inflate(getLayoutInflater());
        return binding.getRoot();
    }

    @Override
    public void onViewCreated(@NonNull View view, @Nullable Bundle savedInstanceState) {
        super.onViewCreated(view, savedInstanceState);
        loadData();
        adapter = new CarAdapter(carList, imageList);
        binding.rvView.setAdapter(adapter);
    }

    private void loadData() {

        carList.add("Bugatti");
        imageList.add("data:image/jpeg;base64,");

        carList.add("Audi");
        imageList.add("data:image/jpeg;base64,");

        carList.add("Pagani");
        imageList.add("data:image/jpeg;base64,");

        carList.add("Lamborghini");
        imageList.add("data:image/jpeg;base64,");

        carList.add("KIA");
        imageList.add("data:image/jpeg;base64,");
    }
}